MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "CalibrenmMPC is a suite of functions for modeling, simulating, and correcting distortions of the mask manufacturing process. Models generated by this process are utilized by Calibre nmMPC and FRACTURE tools to accurately reflect the final output of the mask process.");
MGCAddSnippet(5, "Calibre nmMPC accounts for errors that occur during the mask process, improving mask Critical Distance (CD) uniformity and linearity.Total mask CD error is typically a combination of proximity effects (referred to as short range effects) and long range effects:");
MGCAddSnippet(6, "The Mask Process Correction (MPC) works along with the Optical Process Correction (OPC) workflow. Different models are generated to account for mask process effects (etch, e-beam, and long range effects) and the models are then used by Calibre to make corrections to the design layout, much as the OPC process uses models to account for optical, resist, and etch effects on the wafer.");
MGCAddSnippet(7, "The overall mask process correction flow for Calibre nmMPC can be summarized in three basic stages.");
MGCAddSnippet(8, "Before you begin the Calibre nmMPC process, there are several prerequisites.");
MGCAddSnippet(9, "The MPC flow touches on several Calibre tools. ");
MGCAddSnippet(10, "The correction stage of Calibre nmMPC runs in batch mode, which requires an SVRF file to be processed by the Calibre nmDRC-H hierarchical database engine.The processing is invoked from a shell tool command line. ");
MGCAddSnippet(11, "Calibre nmMPC can be run on the CalibreFullScale platform. However, there are some limitations.");
MGCAddSnippet(12, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(13, "The first stage of a Mask Process Correction flow is generating a test mask with initial data models to measure long range and proximity effects.The calibration mask contains the test structures needed to calibrate the models.");
MGCAddSnippet(14, "Before you begin this stage, you must have the prerequisite information available as input.");
MGCAddSnippet(15, "To generate a test layout, run the mpcCompile Tcl command.");
MGCAddSnippet(16, "The second stage of the Calibre nmMPC flow is model creation and calibration.");
MGCAddSnippet(17, "Before starting the modeling stage, there are several prerequisites.");
MGCAddSnippet(18, "Calibre nmMPC uses a modified version of the Calibre WORKbench test pattern engine to create its proximity (density) and uniformity (long-range) patterns, which are compiled into a single composite test pattern. The tools designed for Calibre nmMPC output gauge data files, each of which must be filled in according to the results of measuring a test chip on the structures.");
MGCAddSnippet(19, "The largest sources of mask systematic error are treated with a Variable Etch Bias (VEB) model. Rigorous  first-principles  based modeling of etch effects are typically too complex for full-chip type applications.");
MGCAddSnippet(20, "Long-range effect models are calibrated and built using a particular sequence.");
MGCAddSnippet(21, "Optimize the Gaussian sigma (kernel size) for a Density Convolve model only.");
MGCAddSnippet(22, "Load the test pattern layout (known as a gauge file) into MPC Center in Calibre WORKbench.");
MGCAddSnippet(23, "Add kernels, uniformity order, and BTERMS for the Long Range model.");
MGCAddSnippet(24, "Set optimization options in MPC Center for the Long Range model.");
MGCAddSnippet(25, "Input a model or layer file in MPC Center.");
MGCAddSnippet(26, "Build a uniformity polynomial in MPC Center.");
MGCAddSnippet(27, "Use the T (Try) option for Long Range models to extract Long Range effects from the Short Range data");
MGCAddSnippet(28, "Build the calibrated short range model.");
MGCAddSnippet(29, "Load the corrected short range measurements into MPC Center.");
MGCAddSnippet(30, "Enter the kernels and term coefficients for the VEB model form.");
MGCAddSnippet(31, "Enter VEB model optimization parameters in MPC Center.");
MGCAddSnippet(32, "Enter a model or layer file in MPC Center and build the corrected VEB Short Range Model.");
MGCAddSnippet(33, "The E-beam model captures very short range effects caused by electron beam forward scattering and beam blur.");
MGCAddSnippet(34, "Configure the E-beam model in the Ebeam tab of MPC Center.");
MGCAddSnippet(35, "MPC Center also contains two additional tabs, Contour and Remote.");
MGCAddSnippet(36, "The MPC Center contains a number of menu-based operations that are identical to those used in CM1 Center. ");
MGCAddSnippet(37, "With the long-range and proximity models now calibrated, a rule deck can be constructed to simulate the mask and apply corrections to the layout (as well as perform a FRACTURE in the same run).");
MGCAddSnippet(38, "Before you begin this stage, you should already fulfilled a number of prerequisites.");
MGCAddSnippet(39, "Once the models are created and calibrated, the mask can now be corrected by creating a Calibre nmMPC setup file, a file that contains commands that reference the long range and short range simulation models and uses them to adjust the mask polygons. ");
MGCAddSnippet(40, "You should have your model information prepared prior to creating the setup file. Once created, import the models into Calibre nmMPC.");
MGCAddSnippet(41, "A layer contains polygon information that is used by the Calibre RET batch tools to simulate and correct your mask layout design. ");
MGCAddSnippet(42, "A Calibre nmMPC image command is required in the denseopc_options block. Any non-empty combination of E-beam or etch models can be used; E-beam-only, etch-only, or E-beam and etch. This statement parameterizes the simulated image that is used to compute EPEs. For example:");
MGCAddSnippet(43, "The number of iterations can be controlled with the command max_iterations. Depending on the model and correction accuracy requirements, only 1 to 3 iterations will be needed in most cases. ");
MGCAddSnippet(44, "Convergence occurs when the results of MPC edge correction reflect the closest possible representation of the original mask feature (the simulation results  converge  on the original design). Although convergence is the intended result of MPC, achieving that convergence can often be difficult. Calibre nmMPC makes corrections based on an iteration of measurement, corrective edge movement, then further measurement. ");
MGCAddSnippet(45, "Post-OPC data already has fragmented edges. In most cases no additional fragmentation is needed or warranted.");
MGCAddSnippet(46, "A constraint is a behavioral limitation observed by MPC. A Mask Rule Constraint (MRC) is a type of spacing-based constraint where the rules are enforced on the photomask.");
MGCAddSnippet(47, "A  No Correction  region is an area designated on the layout where MPC will not be performed. This prevents any unintended fragment edge movement that can impact the final mask (particularly in areas where no further correction is warranted).");
MGCAddSnippet(48, "Biasing operations can occasionally introduce many small irregularities (such as excess jogs or overcorrection) that degrade the overall shapes, preventing clean fragmentation and making the target layer unsuitable for correction.");
MGCAddSnippet(49, "A special correction mode, called SEM Box correction, can be enabled for convex and concave corner fragments.");
MGCAddSnippet(50, "Once you fragment a polygon, you may only wish to target minor adjustments to certain edges, rather than all fragments. To target those specific fragment edges, you can place unique tags to separate them from the rest of the fragments.");
MGCAddSnippet(51, "Calibre nmCLMPC uses an alternative setup file targeted specifically for curvilinear layouts (layouts with skew-edge shapes), known as curvilinear mask process correction or CLMPC. ");
MGCAddSnippet(52, "The E-beam model simulates a special class of short-range effects, known as E-beam effects, are typically triggered by forward scattering and beam blur. ");
MGCAddSnippet(53, "Edge placement error (EPE) is the difference between the drawn edge of a polygon and either the simulated silicon edge or actual silicon edge when printed. How EPE is measured varies according to the feature (such as if a fragment is adjacent to a convex or concave corner, at a line end, or if it is a non-corner edge). ");
MGCAddSnippet(54, "Long-range pattern density correction utilizes the DENSITY CONVOLVE SVRF statement to generate the biasing map over the mask, and MAPSIZE to resize elements of the layout.");
MGCAddSnippet(55, "Proximity or short-range correction can be handled through two different available models.");
MGCAddSnippet(56, "Validate the output of your correction run using Calibre OPCverify and with Calibre nmMPC.");
MGCAddSnippet(57, "You can validate the output of your correction run using the Calibre OPCverify command measure_epe. Specifically, you can find the MPC fragments where the EPE lies in a specified interval.");
MGCAddSnippet(58, "EPEs in an MPC recipe can be verified by deriving a specific EPE layer, running a Calibre nmMPC simulation, and then passing it to Calibre MPCverify for verification. When generating the EPE layer, the measurement locations should be consistent with the correction layer. This means specifying an opc layer as the target layer, and an external layer as the corrected layer for EPE layer verification. Measurement sites are placed in the opc target layer, and the external layer is used for simulation. This ensures that both the correction flow and verification flow get the same measurement points, provided the same recipe settings for fragmentation, epe_spacing, and so on, in both flows.");
MGCAddSnippet(59, "Calibre nmMPC is largely a batch command-based tool. All major operations can be performed through batch commands in the setup file.");
MGCAddSnippet(60, "The following table summarizes the commands used for test layout generation.");
MGCAddSnippet(61, "Generates a proximity, uniformity, and mask model test layout (combines the execution of ptpCompile, uniCompile, and mtpCompile).");
MGCAddSnippet(62, "Generates a proximity model (short range) test layout and corresponding measurement spreadsheet.");
MGCAddSnippet(63, "The ptpCompile input file is used to define the parameters for the ptpCompile run.");
MGCAddSnippet(64, "Generates a uniformity test mask layout and corresponding spreadsheet.");
MGCAddSnippet(65, "The uniCompile input file defines the parameters for the uniCompile run.");
MGCAddSnippet(66, "Generates a mask model (short-range and long range) test layouts, which consists of proximity, density loading, and uniformity models.");
MGCAddSnippet(67, "The mtpCompile input file is used to define the parameters for the mtpCompile run.");
MGCAddSnippet(68, "The following table lists commands used for MPC Calibration batch mode.");
MGCAddSnippet(69, "Removes the proximity bias from long-range spreadsheets and gauge files respectively.");
