MGCAddSnippet(71, "Determines the optimized Gaussian sigmas in specified ranges that give the best fit to the density data.");
MGCAddSnippet(72, "Evaluates the long-range model at each location in the input spreadsheet, subtracts the implied bias from the spreadsheet entry, and outputs the new spreadsheet with prediction CDs and fit errors.");
MGCAddSnippet(73, "The Long-Range Model File format defines long-range model parameters that are input into the MPC Evaluation function.");
MGCAddSnippet(74, "Calibrates an E-beam model, working with the VEB model to search for the optimized Gaussian sigma value in the E-beam model.");
