MGCAddSnippet(185, "Calibre nmModelflow contains functionality to create a Calibre nmMPC-relevant litho model file via a GUI wizard. At least one litho model must be present in the database to perform calibration.");
MGCAddSnippet(186, "After removing long range effects in MPC Center, you load the resulting gauge file into the Calibre nmModelflow database.");
MGCAddSnippet(187, "Stages define operations to be performed on a litho model. For Calibre nmMPC, you must create at least one calibration stage; other stages can be created for supporting information.");
